import React from "react";
import { View, Text, StyleSheet, TouchableOpacity} from "react-native";
import Feather from "react-native-vector-icons/Feather";


export default function Listagem_pets({ data, deleteItem, editItem}) {
    return (
        <View>
        <View style={styles.container}>
            <Text style={styles.text}>Protetor: {data.protetor}</Text>
            <Text style={styles.text}>Tipo: {data.tipo}</Text>
            <Text style={styles.text}>Nome: {data.nome}</Text>
            <Text style={styles.text}>Porte: {data.porte}</Text>
            <Text style={styles.text}>Ra√ßa: {data.raca}</Text>
            <Text style={styles.text}>Idade: {data.idade}</Text>


            

        </View>

        <View style={styles.areaBtn}>
            <TouchableOpacity style={styles.botao} onPress={()=> deleteItem(data.id)}>
                <Text style={styles.botaoText}>Deletar</Text>
            </TouchableOpacity>
            <TouchableOpacity style={styles.botao} onPress={()=> editItem(data.id)}>
                <Text style={styles.botaoText}>Editar</Text>
            </TouchableOpacity>
            </View>

    </View>

    );
}
const styles = StyleSheet.create({
    container: {
        flex: 1, marginTop: 10,
        marginBottom: 5,
        padding: 10,
        backgroundColor: '#4F7063'


    },
    text: {
        color: '#FFF', fontSize: 17

    },
    areaBtn: {
        alignItems: "center",
        flexDirection: "row",
        marginBottom:15,
        marginLeft:15,
        marginRight:15,
        justifyContent: "space-between",
      },
      botao: {
        backgroundColor: "#1d75cd",
        height:55,
        justifyContent: "center",
        alignItems: "center",
        padding: 15,
        borderRadius: 5,
      },
      botaoText: {
        fontSize: 22,
        color: "#FFF",
      },
});
